import Header from './Header';
import myNav from './Navbar';

const layoutStyle = {
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div style={layoutStyle}>
    <myNav />
    {props.children}
  </div>
);

export default Layout;
